import React from 'react';
import {NavLink} from "react-router-dom";

const NavBar = () => {
    return (
        <div>
            <div className=" ui secondary pointing menu ">
                <NavLink className="item">
                    Home
                </NavLink>
                <NavLink className="item">
                    Messages
                </NavLink>
                <NavLink className="item ">
                    Friends
                </NavLink>
                <div className="right menu">
                    <NavLink className="ui item">
                        Logout
                    </NavLink>
                </div>
            </div>

        </div>
    );
};

export default NavBar;
